import "../page/style/RightBox.css";

function RightBox() {
  return (
    <div className="RightBox">
      <div className="best-name">최근 게시물</div>
      <div className="best-box-content">
        <div>content</div>
        <div>date</div>
      </div>
    </div>
  );
}

export default RightBox;
